import React, { useState, useEffect } from 'react';
import './media-queries.css';

function Menu() {
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
      };
    return (
        <><button className="menu" onClick={toggleMenu}>Menu</button><div className={`mobile-menu ${isMenuOpen ? 'open' : ''}`}>
            <span>Log in</span>
        </div></>
    );
}
export default Menu;
